import { Link, Outlet } from "react-router-dom";
const Menu = () => {
  return (
    <div>
      <nav>
        <ul>
          <li>
            <Link to="/">Home</Link>
          </li>
        </ul>
        <li>
          <Link to="/about">About Us</Link>
        </li>

        <li>
          <Link to="/contact">Contact Us</Link>
        </li>
      </nav>
      <Outlet />
    </div>
  );
};

export default Menu;
